IF OBJECT_ID('dbo.proc_transform_105', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_105;
GO
CREATE PROCEDURE dbo.proc_transform_105
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_105
    SET payload = LEFT(payload, 1000) + N'|V4-105|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_105;
END
GO
IF OBJECT_ID('dbo.audit_v4_105', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.audit_v4_105 (aid INT IDENTITY(1,1) PRIMARY KEY, msg NVARCHAR(2000), created_on DATETIME2 DEFAULT SYSUTCDATETIME());
END
GO
EXEC dbo.proc_transform_105;
GO

CREATE INDEX IDX_staging_105_payload ON dbo.staging_table_105 (id);
